import FooterLinkData from "../data/Footer-link-data";

function FooterLink(){
    const ListFooterLinkData = FooterLinkData.map((Element) =>
        <ul> {Element.titre}
            {Element.link.map((Elements) =>
                <li></li>
            )}
        </ul>
    )

    return (
        <div>{ListFooterLinkData}</div>
    )
}

export default FooterLink
